import React from 'react';
import './TimelineStyles.css';

const experiences = [
  {
    title: 'Software Engineer - Smart Desert Pvt Ltd | Bengaluru',
    duration: 'May 2022 – Aug 2024',
    description:
      'Built a social media platform using the MERN stack (MongoDB, Express.js, React, Node.js). Integrated Stripe for transactions. Ensured system quality using SQL/Python scripts and Git.',
  },
];

const ExperienceSection = () => (
  <section id="experience" className="timeline-section">
    <h2 className="timeline-title">My Experiences</h2>
    {experiences.map((item, index) => (
      <div key={index} className="timeline-card">
        <h3>{item.title}</h3>
        <p className="timeline-duration">{item.duration}</p>
        <p>{item.description}</p>
      </div>
    ))}
  </section>
);

export default ExperienceSection;
